import './App.css';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';
import Page from './components/Page/Page';
import {Switch} from "react-router-dom";

function App() {
  return (
    <div className="App">
     <Header/>
     <Page/>
     <Footer/>
    </div>
  );
}

export default App;
